import React, {Fragment} from 'react';

const Card = () => {
	return(
		<Fragment>
			<img alt='robots' src='https://robohash.org/test' />
			<div>
				<h2> Yevhen Krylovskyi </h2>
				<p> krylenger@gmail.com </p>
			</div>
		</Fragment>
	);
}

export default Card;
